          <div className='input-group'>
            <label htmlFor='password'>Password</label>
            <input
              type='password'
              name='password'
              className='login-input'
              placeholder='Password'
            />
          </div>

          <button
            type='button'
            className='login-btn'
            onClick={this.submitLogin.bind(this)}
          >
            Login
          </button>
        </div>
      </div>
    );
  }
}
export default App;
